public Collection storeLinks(Collection c)
{
    for(Iterator it = linkStorages.iterator(); it.hasNext();)
    {
        c =  ((LinkStorage)it.next()).storeLinks(c);
        if(c == null)
        {
            break;
        }
    }
    return c;
}

